      <div className="center">
        <div className="form center pa4 br3 shadow-5">
          <input className="f4 pa2 w-70 center" type ='text'onInputChange={onInputChange} />
          <button className="w-30 grow f4 b link ph pv2 dib white bg-red"
          >Detect
